package mp.bridgeSceneFigures;

import java.awt.Graphics;
import java.awt.Graphics2D;
import java.awt.Image;
import java.awt.Toolkit;
import java.awt.image.ImageObserver;
import java.beans.PropertyChangeEvent;

import mp.bridgeSceneObject.Head;
import mp.bridgeSceneObject.Line;
import mp.bridgeSceneObject.StringShape;
import tags301.Comp301Tags;
import util.annotations.Tags;
@Tags(Comp301Tags.PAINT_LISTENER)
public class AnAvatarPainter implements PaintListener {

	BridgeScenePainter aPainter= AFactory.observableBridgeScenePainterFactoryMethod(); 
	Avatar anAvatar; 

	public AnAvatarPainter(Avatar anAvatar) {
		this.anAvatar = anAvatar; 
		listenTo(); 
	}

	void listenTo() {
		anAvatar.registerListener(this);
	}

	@Override
	public void paint(Graphics2D g) { 
		paint(g, this.anAvatar.getSpine()); 
		paint(g, this.anAvatar.getLegs());
		paint(g, this.anAvatar.getArms()); 
		paint(g, this.anAvatar.getHead()); 
		paint(g, this.anAvatar.getStringShape()); 
		System.out.println("Painted");

	}
	public void paint(Graphics2D g, Angle anAngle) {
		paint(g, anAngle.getLeftLine()); 
		paint(g, anAngle.getRightLine()); 
	}

	public void paint(Graphics2D g, Line aLine) {
		g.drawLine(aLine.getX(), aLine.getY(), aLine.getX() + aLine.getWidth(), aLine.getY() + aLine.getHeight()); 
	}

	public void paint(Graphics2D g, Head aHead) {
		Image img = Toolkit.getDefaultToolkit().getImage(aHead.getImageFileName());
		g.drawImage(img, aHead.getX(), aHead.getY(), aHead.getWidth(), aHead.getHeight(), (ABridgeScenePainter)aPainter); 

	}

	void paint(Graphics2D g, StringShape aStringShape) {
		g.drawString(aStringShape.getText(), aStringShape.getX(), aStringShape.getY());
	}

	@Override
	public void propertyChange(PropertyChangeEvent evt) {
		((ABridgeScenePainter) aPainter).repaint();
		System.out.println("Repainted"); 
	}


}

package mp.bridgeSceneFigures;
import mp.bridgeSceneObject.ALine;
import tags301.Comp301Tags; 
import mp.bridgeSceneObject.Line;

import java.beans.PropertyChangeListener;

import bus.uigen.OEFrame;
import bus.uigen.ObjectEditor;
import util.annotations.PropertyNames;
import util.annotations.StructurePattern;
import util.annotations.StructurePatternNames;
import util.annotations.Tags; 


@StructurePattern(StructurePatternNames.BEAN_PATTERN)
@PropertyNames({
	"LeftLine",
	"RightLine",
})

@Tags(Comp301Tags.ANGLE)
public class AngleShape implements Angle {

	static final double RADIUS = 50.0, LEFT_ANGLE = 3*((Math.PI)/4), RIGHT_ANGLE= Math.PI/4; 

	protected Line leftLine, rightLine;

	public AngleShape() {
		leftLine =  new ALine(RADIUS, LEFT_ANGLE);
		rightLine = new ALine(RADIUS, RIGHT_ANGLE);
	}

	public AngleShape(double radius, double leftAngle, double rightAngle) {
		leftLine =  new ALine(radius, leftAngle);
		rightLine = new ALine(radius, rightAngle);
	}

	@Override
	public void scale(double val) {
		this.leftLine.setRadius(val * leftLine.getRadius());
		this.rightLine.setRadius(val * rightLine.getRadius());
	}

	@Override
	public void move(int xVal, int yVal) { 
		setPos(this.leftLine.getX() + xVal, this.rightLine.getY() + yVal); 
		} 
	@Override
	public Line getLeftLine() { return this.leftLine; }
	@Override
	public Line getRightLine() { return this.rightLine; }
	@Override
	public void setPos(int xVal, int yVal) { 
		this.leftLine.move(xVal, yVal); 
		this.rightLine.move(xVal, yVal);
	}
	@Override
	public void registerListener(PropertyChangeListener aListener) {
		this.getLeftLine().addPropertyChangeListener(aListener);
		this.getRightLine().addPropertyChangeListener(aListener);
	}

}

package mp.bridgeSceneObject;
import java.beans.PropertyChangeEvent;
import java.beans.PropertyChangeListener;

public class APropertyListenerSupport implements PropertyListenerSupport {
	public static final int MAX_SIZE = 50;
	
	PropertyChangeListener[] contents = new PropertyChangeListener[MAX_SIZE];
	int size = 0;
	@Override
	public int size() {
		return size;
	}
	@Override
	public PropertyChangeListener get (int index) {
		return contents[index];
	}
	@Override
	public boolean isFull() {
		return size == MAX_SIZE;

	}
	@Override
	public void add(PropertyChangeListener listener) {
		if (isFull())
			System.out.println("Adding item to a full collection");
		else {
			contents[size] = listener;
			size++;
		}
	}
	
	@Override
	public void notifyAllListeners(PropertyChangeEvent event) {
		for (int index = 0; index < size(); index++) {			
			get(index).propertyChange(event);
		}
	}
	@Override 
	public void remove(PropertyChangeListener element) {
		contents[indexOf(element)] = contents[size - 1];
		size--;
	}
	@Override
	public void remove(int startIndex) {
		shiftUp(startIndex);
		size--;
	}

	private void shiftUp(int startIndex) {
		for (int index = startIndex; index + 1 < size; index++)
			contents[index] = contents[index + 1];
	}
	@Override
	public int indexOf(PropertyChangeListener element) {
		int index;
		for (index = 0; index < size && !element.equals(contents[index]); index++)
			;
		return index;
	}
	@Override
	public boolean member(PropertyChangeListener element) {
		return indexOf(element) < size;

	}
	@Override
	public void clear() {
		size = 0;
	}
}

package mp.bridgeSceneObject;
import java.beans.PropertyChangeEvent;
import java.beans.PropertyChangeListener;

import bus.uigen.OEFrame;
import bus.uigen.ObjectEditor;
import mp.bridgeSceneFigures.Avatar;
import mp.bridgeSceneFigures.Body;
import tags301.Comp301Tags;
import util.annotations.Tags;
import util.annotations.Visible;
import util.misc.ThreadSupport;
import util.annotations.StructurePattern;
import util.annotations.StructurePatternNames;


@StructurePattern(StructurePatternNames.LINE_PATTERN)

@Tags(Comp301Tags.ROTATING_LINE)
public class ALine extends ADeminsion implements Line {

PolarPoint polarPoint; 

public ALine(double radius, double angle) {
	polarPoint = new APolarPoint(radius, angle); 
}

public ALine() {
	polarPoint = new APolarPoint(); 
}

@Override
public int getWidth() {return polarPoint.getX();}
@Override
public int getHeight() {return polarPoint.getY();}
@Override
public void rotate(int val) {
	int previousHeight=getHeight(), previousWidth=getWidth(); 
	polarPoint.changeAngle((val* (Math.PI/16)) + polarPoint.getAngle());
	aListener.notifyAllListeners(new PropertyChangeEvent(this, "Height", previousHeight, getHeight()));
	aListener.notifyAllListeners(new PropertyChangeEvent(this, "Height", previousWidth, getWidth()));}
@Override
public void setRadius(double val) {
	double previousWidth = getWidth();
	double previousHeight = getHeight();
	polarPoint.setRadius(val);
	aListener.notifyAllListeners(new PropertyChangeEvent(this, "Width", previousWidth, getWidth()));
	aListener.notifyAllListeners(new PropertyChangeEvent(this, "Height", previousHeight, getHeight()));
}
@Override
public void setAngle(double val) {
	double previousWidth = getWidth();
	double previousHeight = getHeight(); 
	polarPoint.changeAngle(val);
	aListener.notifyAllListeners(new PropertyChangeEvent(this, "Width", previousWidth, getWidth()));
	aListener.notifyAllListeners(new PropertyChangeEvent(this, "Height", previousHeight, getHeight()));
}
@Override
public double getRadius() { return polarPoint.getRadius(); }
@Override 
public double getAngle() { return polarPoint.getAngle(); }
@Override
public void move(int x, int y) { 
	int previousX= getX(), previousY=getY(); 
	this.x= x;  
	this.y=y; 
	aListener.notifyAllListeners(new PropertyChangeEvent(this, "X", previousX, getX())); 
	aListener.notifyAllListeners(new PropertyChangeEvent(this, "Y", previousY, getY())); 
}

@Override
public void registerListener(PropertyChangeListener aListener) {
	this.addPropertyChangeListener(aListener);
	super.aListener.notifyAll();

}

@Override
public void changeAngle(double val) {
	polarPoint.changeAngle(val);
}
}

